        error5 = finalPlayer.player5 == finalPlayer.player2 ||
            finalPlayer.player5 == finalPlayer.player3 ||
            finalPlayer.player5 == finalPlayer.player4 ||
            finalPlayer.player5 == finalPlayer.player1
