                    <option value="default" disabled hidden selected>Select Player</option>
                    {final.length > 0 ? final.map((i) => { return <option value={`${i.fname}${i.lname}${i.id}`}>{i.fname} {i.lname}</option> }) : null}
                </select>
                <select name="player3" className="sel" onChange={handleNameChange3}>
                    <option value="default" disabled hidden selected>Select Player</option>
                    {final.length > 0 ? final.map((i) => { return <option value={`${i.fname}${i.lname}${i.id}`}>{i.fname} {i.lname}</option> }) : null}
                </select>
                <select name="player4" className="sel" onChange={handleNameChange4}>
                    <option value="default" disabled hidden selected>Select Player</option>
                    {final.length > 0 ? final.map((i) => { return <option value={`${i.fname}${i.lname}${i.id}`}>{i.fname} {i.lname}</option> }) : null}
                </select>
                <select name="player5" className="sel" onChange={handleNameChange5}>
                    <option value="default" disabled hidden selected>Select Player</option>
                    {final.length > 0 ? final.map((i) => { return <option value={`${i.fname}${i.lname}${i.id}`}>{i.fname} {i.lname}</option> }) : null}
                </select>
            </div>
            <div style={divStyle}>
